tables.table_schema:
CREATE TABLE TransactionLogs (
  log_id INT PRIMARY KEY,
  transaction_type VARCHAR(50),
  transaction_details VARCHAR(255),
  timestamp TIMESTAMP
);

CREATE TABLE TradeSimulation (
  simulation_id INT PRIMARY KEY,
  simulation_description TEXT,
  start_time TIMESTAMP,
  end_time TIMESTAMP
);

CREATE TABLE historical_data (
  data_id INT PRIMARY KEY,
  trade_symbol VARCHAR(50),
  historical_price DECIMAL(10, 2),
  data_timestamp TIMESTAMP
);

CREATE TABLE order_executions (
  execution_id INT PRIMARY KEY,
  order_id INT,
  execution_price DECIMAL(10, 2),
  execution_timestamp TIMESTAMP
);

CREATE TABLE trade_results (
  result_id INT PRIMARY KEY,
  order_id INT,
  execution_id INT,
  trade_result VARCHAR(50)
);

CREATE TABLE order_history (
  history_id INT PRIMARY KEY,
  order_id INT,
  status VARCHAR(20),
  history_timestamp TIMESTAMP
);
